import React, { Component } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import "../welcome/Welcome.css";
import { Link  } from "react-router-dom";
import slick1 from "../images/slick/slick1.jpg";
import slick2 from "../images/slick/slick2.jpg";
import slick3 from "../images/slick/slick3.jpg";
import slick4 from "../images/slick/slick4.jpg";
import slick5 from "../images/slick/slick5.jpg";
import slick6 from "../images/duedate.png";


export default class Responsive extends Component {
  render() {
    var settings = {
      dots: true,
      infinite: false,
      speed: 500,
      slidesToShow: 4,
      slidesToScroll: 4,
      initialSlide: 0,
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
    };
      return (

        // <div className="container">
        <div className="container">
        <h3 className="main-head">How can we help?</h3>
          <Slider {...settings}>
          <div>
            <Link to="/symptoms">
            <img src={slick1} alt="logo" width="200" height="200"/>
            </Link>
          </div>
          <div>
            <Link to="/baby">
            <img src={slick2} alt="logo" width="200" height="200"/>
            </Link>
          </div>
          <div>
            <Link to="/body">
            <img src={slick4} alt="logo" width="200" height="200"/>
            </Link>
          </div>
          <div>
            <Link to="/labor&delivery">
            <img src={slick3} alt="logo" width="200" height="200"/>
            </Link>
          </div>
          <div>
            <Link to="/nutrition">
            <img src={slick5} alt="logo" width="200" height="200"/>
            </Link>
          </div>
          <div>
            <Link to="/babynamefinder">
            <img src={slick1} alt="logo" width="200" height="200"/>
            </Link>
          </div>
          </Slider>

        // </div>

      );
    }
  }
